olor=\"#0000ff\">Format 1 A</font></a>,&nbsp;&nbsp;<a href=\"http://disdik.kebumenkab.go.id/web/download_process/45?from=post\" arial=\"\" unicode=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-weight:=\"\" normal;=\"\" font-style:=\"\" text-align:=\"\" justify;=\"\" text-decoration:=\"\" underline;=\"\" color:=\"\" rgb(147,=\"\" 97,=\"\" 16);\"=\"\" style=\"margin: 0px; padding: 0px; font-size: 12px;\"><font color=\"#0000ff\">Format 1 B</font>.</a><br>&nbsp;&nbsp;<strong>· Sekolah Tidak Operasional / Sudah Tutup</strong>&nbsp;:&nbsp;<a href=\"http://disdik.kebumenkab.go.id/web/download_process/46?from=post\" arial=\"\" unicode=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-weight:=\"\" normal;=\"\" font-style:=\"\" text-align:=\"\" justify;=\"\" text-decoration:=\"\" underline;=\"\" color:=\"\" rgb(147,=\"\" 97,=\"\" 16);\"=\"\" style=\"margin: 0px; padding: 0px; font-size: 12px;\"><font color=\"#0000ff\">Format 2A</font></a>,&nbsp;<a href=\"http://disdik.kebumenkab.go.id/web/download_process/47?from=post\" arial=\"\" unicode=\"\" ms\",=\"\" helvetica,=\"\" sans-serif;=\"\" font-weight:=\"\" normal;=\"\" font-style:=\"\" text-align:=\"\" justify;=\"\" text-decoration:=\"\" underline;=\"\" color:=\"\" rgb(147,=\"\" 97,=\"\" 16);\"=\"\" style=\"margin: 0px; padding: 0px; font-size: 12px;\"><font color=\"#0000ff\">Format 2B</font></a>&nbsp;</td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"91\">&nbsp;Sekretariat</td></tr></tbody></table><p style=\"margin-top: 12px; margin-bottom: 12px; font-size: 12px; text-align: justify; padding: 0px;\"><strong>PENTING :</strong><br><em>#.&nbsp; Apabila Ijazah / STTB hilang, buatlah surat keterangan kehilangan dari Kepolisian setempat.</em><br><em>#. Jika masih ada memiliki salinan atau fotokopi ijazah/STTB yang hilang, dilampirkan ketika pembuatan surat keterangan kehilangan dan membuatan Surat Keterangan dari Dinas Pendidikan.</em><br><em>#. Apabila