er: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"161\"><strong>PERMOHONAN CETAK SERTIFIKAT NPSN</strong></td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"362\">– Surat Permohonan cetak NPSN<br>– Foto copy Ijin Pendirian dan Operasional Sekolah&nbsp;</td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"91\">&nbsp;Sekretariat</td></tr><tr><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"5\"><strong>8</strong></td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"161\"><strong>IJIN PENDIRIAN / PERPANJANGAN IJIN PKBM / LKP</strong></td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"362\">– Mengajukan Proposal dari lembaga tentang Permohonan Ijin &nbsp;Pendirian/ Perpanjangan Ijin Operasional.<br>&nbsp;</td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"91\">Bidang PAUD Dikmas dan Kebudayaan</td></tr><tr><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"5\">9</td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"161\"><strong>IJIN PENDIRIAN SEKOLAH</strong></td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: left;\" width=\"362\">– Permendikbud No.36/2014<p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px;\"></p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px;\">&nbsp;</p></td><td style=\"padding: 2px; border: 1px solid rgb(128, 153, 179); vertical-align: top; text-align: center;\" width=\"91\">Bidang Pendidikan Dasar</td></tr></tbody></table>', 'pe