INSERT INTO `_post` VALUES ('61', '9', '', '', 'Hati-hati, Ada Risiko Pengangguran Baru Akibat Padat Karya Cash', '2018-02-09 09:14:38', '<p><b style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Jakarta</b><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">&nbsp;- Program padat karya cash yang mulai dijalankan Presiden Joko Widodo (Jokowi) dinilai sebagai solusi cepat dan menjanjikan untuk mendongkrak konsumsi masyarakat dan menanggulangi masalah pengangguran.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Namun ekonom yang juga mantan Menteri Keuangan Chatib Basri memberikan peringatan dini, bila tak diperhatikan dengan baik, program ini menyimpan risiko menciptakan pengangguran baru di Indonesia.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">\"Yang perlu diperhatikan adalah upah. Kalau upahnya lebih besar dari UMP (Upah Minimum Provinsi), maka bisa memancing orang yang sudah bekerja di sektor formal untuk pindah, ikut program padat karya cash,\" kata dia saat berbincang dengan&nbsp;</span><strong style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">detikFinance</strong><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">&nbsp;belum lama ini.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"></p><div id=\"beacon_8c48de35ee\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=674&amp;loc=https%3A%2F%2Ffinance.detik.com%2Fberita-ekonomi-bisnis%2Fd-3858109%2Fhati-hati-ada-risiko-pengangguran-baru-akibat-padat-karya-cash%3F_ga%3D2.198383083.537181493.1518142319-1115255531.1516191846&amp;referer=http%3A%2F%2Fwww.detik.com%2F&amp;cb=8c48de35ee\" width=\"0\" height=\"0\" alt=\"\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; height: 0px; width: 0px;\"></div><p><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Padahal, lanjut Chatib, tujuan padat karya cash bukan lah untuk menciptakan lapangan kerja baru melainkan untuk memberikan alternatif pemasukan bagi masyarakat miskin untuk memperbaiki daya beli dan tingkat konsumsi rumah tangga.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Chatib mengakui, di tahun politik tentu akan banyak tekanan dari berbagai pihak untuk meningkatkan upah bagi masyarakat yang terlibat dalam program pada karya cash.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"></p><table class=\"linksisip\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><tr style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><td style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><div class=\"lihatjg\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><strong style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\">Baca juga:&nbsp;</strong><a href=\"https://finance.detik.com/readfoto/2018/02/08/200059/3857751/461/1/jokowi-hujan-hujanan-pantau-pelaksanaan-program-padat-karya-cash\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; border: none; font-weight: bold; color: rgb(215, 25, 33);\"><span style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: blue;\">Jokowi Hujan-hujanan Pantau Pelaksanaan Program Padat Karya Cash</span></a></div></td></tr></tbody></table><p><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">\"Pasti ada saja yang desak dengan kata-kata, \'naikin dong, masa mau bantu masyarakat tapi setengah-setengah? Masa bantuannya hanya segitu?\'. Saran saya pemerintah bisa bertahan terhadap tekanan itu,\" papar Chatib.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Karena, bila pemerintah tak kuat menahan tekanan tersebut, bukan tidak mungkin program padat karya cash malah bakal jadi produk yang gagal total dan malah mengganggu ekonomi Indonesia secara keseluruhan.</span><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">\"Dulu hal seperti itu pernah terjadi di India. Karena tekanan tinggi dan pemerintahnya tak kuat dengan tekanan itu, programnya malah gagal. Itu berbahaya sekali,\" tandasnya.</span></p><p><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br></span></p><table class=\"linksisip\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><tr style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><td style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><div class=\"lihatjg\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\"><strong style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased;\">Baca juga:&nbsp;</strong><a href=\"https://finance.detik.com/readfoto/2018/02/07/201942/3855767/461/1/ini-dia-program-padat-karya-cash-pertama-jokowi\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; border: none; font-weight: bold; color: rgb(215, 25, 33);\"><span style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: blue;\">Ini Dia Program Padat Karya Cash Pertama Jokowi</span></a></div></td></tr></tbody></table><p><strong style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">(ang/ang)</strong></p><p><strong style=\"text-rendering: optimizeLegibility; -webkit-font-smoothing: antialiased; color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\">Sumber : detik.com<br></strong><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial, sans-serif; font-size: 16px;\"><br></span><br></p>', 'hati-hati--ada-risiko-pengangguran-baru-akibat-padat-karya-cash', '7', '1', '0', '0', '0', '1', null, null, '1');
INSERT INTO `_post` VALUES ('62', '9', '', '', 'Warner Bros Kini Dekati Joaquin Phoenix untuk \'Joker\'', '2018-02-09 09:27:50', '<p><b style=\"box-sizing: border-box; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Jakarta</b><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">&nbsp;-&nbsp;</span><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Nama Leonardo DiCaprio simpang siur dikabarkan tengah didekati untuk memerankan Joker beberapa waktu lalu. Akan tetapi, entah hal itu tak disetujui sang aktor atau bukan, kabar terbaru menyebut Warner Bros tengah melakukan pendekatan ke aktor lain.</span><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">&nbsp;</span></p><p style=\"box-sizing: border-box; margin-bottom: 20px; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\"><br style=\"box-sizing: border-box;\">Ia adalah Joaquin Phoenix seperti dilaporkan Variety, Jumat (9/1/2018). Bintang 43 tahun itu disebut sudah menyetujui menerima peran tersebut.&nbsp;<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">Akan tetapi Warner Bros belum memberikan pernyataan secara resmi.&nbsp;<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"></p><div id=\"beacon_23e0f1448e\" style=\"box-sizing: border-box; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=691&amp;loc=https%3A%2F%2Fhot.detik.com%2Fmovie%2Fd-3858117%2Fwarner-bros-kini-dekati-joaquin-phoenix-untuk-joker%3F_ga%3D2.224196063.537181493.1518142319-1115255531.1516191846&amp;referer=https%3A%2F%2Fwww.detik.com%2F&amp;cb=23e0f1448e\" width=\"0\" height=\"0\" alt=\"\" style=\"box-sizing: border-box; width: 0px; height: 0px;\"></div><p></p><div id=\"beacon_23e0f1448e\" style=\"box-sizing: border-box; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=691&amp;loc=https%3A%2F%2Fhot.detik.com%2Fmovie%2Fd-3858117%2Fwarner-bros-kini-dekati-joaquin-phoenix-untuk-joker%3F_ga%3D2.224196063.537181493.1518142319-1115255531.1516191846&amp;referer=https%3A%2F%2Fwww.detik.com%2F&amp;cb=23e0f1448e\" width=\"0\" height=\"0\" alt=\"\" style=\"box-sizing: border-box; width: 0px; height: 0px;\"></div><p><span style=\"color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Ini bukan menjadi kali pertama bagi Joaquin Phoenix. Sebelumnya ia ditawarkan memerankan Lex Luthor, musuh Superman untuk \'Batman v Superman: Dawn of Justice\' namun menolak. Bahkan Disney juga mendekatinya untuk memerankan \'Doctor Strange\' yang akhirnya diterima oleh Benedict Cumberbatch.</span></p><p style=\"box-sizing: border-box; margin-bottom: 20px; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\"></p><table class=\"linksisip\" style=\"box-sizing: border-box; width: 540px; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody style=\"box-sizing: border-box;\"><tr style=\"box-sizing: border-box;\"><td style=\"box-sizing: border-box;\"><div class=\"lihatjg\" style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\">Baca juga:&nbsp;</strong><a href=\"https://hot.detik.com/read/2017/09/04/091730/3627075/229/leonardo-dicaprio-diincar-perankan-joker-bagaimana-nasib-jared-leto\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"box-sizing: border-box; color: rgb(183, 0, 0); transition: all 200ms linear 0s; font-weight: bold;\"><span style=\"box-sizing: border-box; color: blue;\">Leonardo DiCaprio Diincar Perankan Joker, Bagaimana Nasib Jared Leto?</span></a></div></td></tr></tbody></table><p style=\"box-sizing: border-box; margin-bottom: 20px; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\"><br style=\"box-sizing: border-box;\">Film solo Joker menjadi proyek Warner Bros yang diputuskan dibuat di luar lingkaran semesta DC. Sutradara trilogi \'Hangover\', Todd Phillips telah ditunjuk untuk menggarap film tersebut.&nbsp;<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">Phillips juga ambil bagian menulis skenario yang akan membawa cerita Joker berlatar tahun 1980-an.&nbsp;<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">Kisah Joker disebut akan menampilkan transformasi sang badut menjadi master kriminal di kota Gotham. Dibuat dalam kisah drama, maka rangkaian cerita Joker bakal jauh dari ceritanya di komik.</p><p><br style=\"box-sizing: border-box; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\"><strong style=\"box-sizing: border-box; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">(doc/doc)</strong></p><p><strong style=\"box-sizing: border-box; color: rgb(45, 45, 45); font-family: helvetica, arial; font-size: 16px;\">Sumber : detik.com</strong></p><p><br></p>', 'warner-bros-kini-dekati-joaquin-phoenix-untuk--joker-', '2', '1', '0', '0', '0', '1', null, null, null);
INSERT INTO `_post` VALUES ('63', '9', '', '', 'Anak-anak Perempuan Rohingya Jadi Korban Perdagangan Manusia', '2018-02-09 09:27:16', '<p><b style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Dhaka</b><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">&nbsp;-&nbsp;</span><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Di suatu tempat di hutan rawa dan lahan sawah yang menjadi perbatasan antara Myanmar dan Bangladesh, Tasmin yang berusia 13 tahun terpisah dari keluarganya dan ditangkap oleh pedagang manusia.</span></p><div id=\"comp-rich-text17\" style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><p style=\"margin-bottom: 20px;\">Pengungsi Rohingya remaja itu tidak pernah sampai di kamp pengungsian di mana seluruh keluarganya sekarang menetap.</p><p style=\"margin-bottom: 20px;\">Ayahnya, Ali Akbar, menghabiskan waktu selama berbulan-bulan mencoba mengetahui apa yang terjadi pada putrinya.</p><p style=\"margin-bottom: 20px;\">\"Kami mengetahui bahwa seorang wanita membawanya ke Dhaka,\" kata Akbar kepada&nbsp;<em>ABC</em>.</p><p style=\"margin-bottom: 20px;\">Dengan tatapan mata yang menyedihkan, dia percaya bahwa itu adalah seorang wanita dari komunitasnya sendiri yang memperdagangkan putrinya.</p><p style=\"margin-bottom: 20px;\">\"Kami mendengar dari banyak sumber bahwa dia adalah seorang wanita Rohingya, bukan orang Bangladesh.\"</p><p style=\"margin-bottom: 20px;\">Tanpa diduga, putrinya menghubungi telepon genggamnya beberapa bulan kemudian dan membenarkan cerita itu.</p><p style=\"margin-bottom: 20px;\">Dia mengatakan kepada Akbar bahwa dia bekerja sebagai pembantu rumah tangga di ibukota Dhaka, dan dia tidak diizinkan meninggalkan rumah tempat dia bekerja.</p><p style=\"margin-bottom: 20px;\">Tapi telepon yang mengejutkannya itu diatur dengan tujuan jahat.</p><div class=\"comp-embedded-float-right\"><div class=\"view-richTallCaptionByline linked\"><div class=\"component comp-image\"><img src=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-large.jpg?v=2\" alt=\"Anak-anak Rohingya\" title=\"Anak-anak Rohingya\" class=\"lazyload\" data-sizes=\"auto\" data-src=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-large.jpg?v=2\" data-srcset=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-large.jpg?v=2 160w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-small.jpg?v=2 220w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-medium.jpg?v=2 460w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9411202-16x9-large.jpg?v=2 700w \" data-expand=\"0\"></div><div class=\"caption\"><em>Anak-anak Rohingya menjadi sasaran para pedagang manusia di perbatasan Bangladesh. (Oleh Siobhan Heanue)</em></div></div></div><p style=\"margin-bottom: 20px;\"><br>\"Mereka menuntut gadis lain untuk diberikan kepada mereka,\" kata Akbar tentang para pedagang yang menahan anak perempuannya.</p><p style=\"margin-bottom: 20px;\">\"Jika saya bisa memberi seorang gadis lagi dalam waktu satu bulan mereka akan membebaskan putri saya dalam enam bulan.\"</p><p style=\"margin-bottom: 20px;\">Tidak tahu mana yang lebih baik, dan tidak tahu bagaimana lagi mengembalikan putrinya, dia meyakinkan seorang teman dari desanya untuk menyerahkan putrinya kepada orang yang sama.</p><p style=\"margin-bottom: 20px;\">Temannya secara rela menyetujui permintaannya, percaya gadisnya akan dikembalikan dalam waktu sebulan sebagaimana yang dijanjikan.</p><p style=\"margin-bottom: 20px;\">Sekarang beberapa bulan telah berlalu, dan kedua gadis itu masih hilang.</p><p style=\"margin-bottom: 20px;\">\"Ibunya menangis sepanjang waktu,\" kata Farim Alam, ayah dari gadis kedua itu.</p><p style=\"margin-bottom: 20px;\">\"Saya memberi anak perempuan saya karena saya ingin mengembalikan anak perempuannya,\" katanya.</p><p style=\"margin-bottom: 20px;\">Putri Farim Alam berusia 12 tahun.</p><p style=\"margin-bottom: 20px;\">Anak-anak mencakup 60 persen dari populasi di kamp-kamp pengungsian, dan seringkali menjadi sasaran langsung dari perdagangan dan pemerkosaan.</p><p style=\"margin-bottom: 20px;\">Para pelaku perdagangan sering berpura-pura sebagai seorang yang mau membantu dan ramah, menjanjikan pekerjaan dengan gaji yang baik atau pernikahan yang baik kepada orang tua dari anak-anak yang ingin mereka ambil.</p><p style=\"margin-bottom: 20px;\">Gadis-gadis muda itu juga menjadi sasaran pria lokal, yang memaksa mereka berhubungan seks dan menjalani pernikahan yang tidak diinginkan.</p><div class=\"view-inlineMediaPlayer doctype-abcvideo\"><div class=\"comp-video-player print-hide\" id=\"video-player19\"><div class=\"js-load-placeholder load-placeholder\"><div class=\"view-richOverlay\"><div class=\"component comp-image\"><img src=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-large.jpg?v=2\" alt=\"Rohingya girls targeted by child traffickers at Bangladesh border crossings\" class=\"lazyload\" data-sizes=\"auto\" data-src=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-large.jpg?v=2\" data-srcset=\"https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-large.jpg?v=2 160w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-small.jpg?v=2 220w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-medium.jpg?v=2 460w, https://akcdn.detik.net.id/abc/www.abc.net.au/cm/rimage/9408634-16x9-large.jpg?v=2 700w \" data-expand=\"0\" style=\"width: 599.5px; height: 337.433px;\"></div></div></div></div></div><br><strong>Dia menyiksa saya</strong><p style=\"margin-bottom: 20px;\">Halima Noor, 18, juga terpisah dari keluarganya saat melintasi perbatasan Bangladesh.</p><p style=\"margin-bottom: 20px;\">Dia mengatakan bahwa dirinya diculik oleh seorang pria setempat dan dipaksa untuk menikah dengannya.</p><p style=\"margin-bottom: 20px;\">\"Dia membawa saya ke rumahnya dan menahan saya di sana selama tiga bulan,\" katanya.</p><p style=\"margin-bottom: 20px;\">\"Dia sering menyiksa saya di sana, itu sungguh menyakitkan.\"</p><p style=\"margin-bottom: 20px;\">\"Ketika saya punya peluang melarikan diri, saya melarikan diri dari rumahnya.\"</p><p style=\"margin-bottom: 20px;\">Halima Noor masih menikah dengan pria yang menyerangnya, meski dia belum pernah mendengar kabar darinya dalam beberapa bulan.</p><p style=\"margin-bottom: 20px;\">Di komunitas Rohingya konservatif, itu berarti dia tidak bisa menikah lagi dan kondisi pelariannya dipandang sebagai sumber rasa malu bagi keluarganya.</p><p style=\"margin-bottom: 20px;\">Bagi gadis-gadis yang hilang dan pengantin muda dari krisis pengungsi Rohingya, melarikan diri dari Myanmar bukanlah akhir dari penderitaan mereka.</p><p style=\"margin-bottom: 20px;\"><em>Simak beritanya dalam Bahasa Inggris&nbsp;<a href=\"https://www.abc.net.au/news/2018-02-08/rohingya-girls-targeted-by-traffickers-at-bangladesh-border/9407522\" target=\"_self\" class=\"external\" style=\"color: rgb(25, 55, 143); font-weight: bold;\">disini</a>.</em></p></div><p><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><div id=\"beacon_ecf8dff364\" style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=642&amp;loc=https%3A%2F%2Fnews.detik.com%2Faustralia-plus-abc%2Fd-3858070%2Fanak-anak-perempuan-rohingya-jadi-korban-perdagangan-manusia%3F_ga%3D2.203177557.537181493.1518142319-1115255531.1516191846&amp;referer=https%3A%2F%2Fwww.detik.com%2F&amp;cb=ecf8dff364\" width=\"0\" height=\"0\" alt=\"\" style=\"height: 0px; width: 0px;\"></div><p><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">(nvc/nvc)</strong></p><p><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sumber : detik.com<br></strong><br></p>', 'anak-anak-perempuan-rohingya-jadi-korban-perdagangan-manusia', '4', '1', '0', '0', '0', '1', null, null, null);
INSERT INTO `_post` VALUES ('64', '9', '', '', 'Setjen: Anggaran Tambahan Pimpinan DPR Sudah Disiapkan dari 2017', '2018-02-09 09:26:52', '<p><b style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Jakarta</b><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">&nbsp;- Revisi Undang-Undang Nomor 17 tahun 2014 tentang MPR, DPR, DPRD, dan DPD (UU MD3) memutuskan penambahan jumlah kursi pimpinan DPR untuk mengakomodir PDIP selaku pemenang Pemilu 2014. Plt Sekretaris Jenderal DPR Damayanti menyebut penambahan pimpinan DPR tak berdampak pada anggaran.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Damayanti atau akrab disapa Maya menyebut, anggaran untuk pimpinan DPR tambahan sudah disiapkan jauh hari sebelum revisi UU MD3 menghasilkan keputusan. Setjen DPR selaku pengalokasi anggaran DPR, kata Maya, sudah menyiapkan langkah antisipasi dari revisi UU MD3 sejak pertengahan tahun 2017.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Kan kita sudah dengar wacana ini dari akhir tahun lalu, pertengahan tahun lalu itu sudah ada wacana. Jadi, kami memang sudah mengantisipasi, kami plot (anggaran) untuk 6 pimpinan,\" sebut Maya saat dihubungi, Kamis (8/2/2018).</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><div id=\"beacon_532ddebbe8\" style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=642&amp;loc=https%3A%2F%2Fnews.detik.com%2Fberita%2Fd-3858082%2Fsetjen-anggaran-tambahan-pimpinan-dpr-sudah-disiapkan-dari-2017%3F_ga%3D2.191504110.537181493.1518142319-1115255531.1516191846&amp;referer=https%3A%2F%2Fwww.detik.com%2F&amp;cb=532ddebbe8\" width=\"0\" height=\"0\" alt=\"\" style=\"height: 0px; width: 0px;\"></div><p><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Untuk diketahui, dalam pagu anggaran 2018, DPR mendapat Rp 5,7 triliun dari APBN 2018. Anggaran tersebut terbagi menjadi dua mata satuan kerja (Satker), yaitu Satker Dewan sekitar Rp 4 triliun dan Satker Kesetjenan sekitar Rp 1,7 triliun. Anggaran tambahan pimpinan DPR dari PDIP disebut Maya tetap akan memakai dana Satker Dewan yang sudah ada.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Itu kita sudah kita anggarkan, tapi nilainya berapa saya nggak hapal. Tapi, seperti yang lain, sudah kita cadangkan, memang sudah ada,\" ucapnya.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Direncanakan, revisi UU MD3 akan dibawa ke rapat paripurna DPR pekan depan. Setelah UU MD3 resmi disahkan, pimpinan DPR akan kembali menggelar rapat untuk berbagai hal terkait pimpinan baru. Untuk diketahui, selain DPR, MPR juga mendapat tambahan pimpinan hingga tiga orang. PDIP, Gerindra, dan PKB, mendapat jatah kursi pimpinan MPR.&nbsp;</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">(gbr/rvk)</strong></p><p><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sumber : detik.com</strong></p><p><br></p>', '', '2', '1', '0', '0', '0', '1', null, null, null);
INSERT INTO `_post` VALUES ('65', '9', '', '', 'Sandi Ingin Asian Games Promosikan Jakarta ke Dunia Internasional', '2018-02-09 09:26:29', '<p><b style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Jakarta</b><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">&nbsp;- Wakil Gubernur DKI Jakarta Sandiaga Uno berharap trotoar di Sudirman-Thamrin dapat tertata rapi sebelum gelaran Asian Games. Sandiaga berharap ajang Asian Games dapat menjadi ajang promosi Jakarta di mata internasional.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Kita akan lakukan simulasi untuk jalur marathon yang akan diliput oleh TV secara live pakai helikopter. Dan akan ditonton oleh 200-300 juta penonton di seuruh dunia. Jadi kita ingin ditampilkan Jakarta yang bisa kita kemas, kita jual,\" kata Sandiaga di Balai Kota, Jalan Medan Merdeka Selatan, Jakarta Pusat, Jumat (9/2/2018).</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sandiaga mengatakan sempat melakukan lari pagi dari rumahnya menuju ke Balai Kota untuk mengecek pengerjaan trotoar oleh MRT. Dia meminta MRT untuk segera menyelesaikan pengerjaan trotoar dengan cantik.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><div id=\"beacon_471eabe699\" style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=642&amp;loc=https%3A%2F%2Fnews.detik.com%2Fberita%2Fd-3858144%2Fsandi-ingin-asian-games-promosikan-jakarta-ke-dunia-internasional&amp;referer=https%3A%2F%2Fnews.detik.com%2Fberita%2Fd-3858167%2Fdesmond-sambut-baik-putusan-mk-yang-tempatkan-kpk-di-ranah-eksekutif&amp;cb=471eabe699\" width=\"0\" height=\"0\" alt=\"\" style=\"height: 0px; width: 0px;\"></div><p><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Jumat kita biasa meneruskan meninjau beberapa fasilitas pedestrian dan juga fasilitas publik di wilayah DKI. Tadi ke Jakarta Selatan dan Pusat, total 12 kilometer kurang lebih. Dan tadi sempet berhenti di fasilitas MRT di Jalan Sudirman melihat kesiapan MRT untuk pastikan perhelatan Asian Games bisa clear road,\" jelasnya.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><table class=\"linksisip\" style=\"width: 540px; color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody><tr><td><div class=\"lihatjg\"><strong>Baca juga:&nbsp;</strong><a href=\"https://sport.detik.com/read/2018/02/08/232712/3857931/78/kemacetan-jakarta-bikin-tim-basket-timor-leste-lelah\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"color: rgb(25, 55, 143); font-weight: bold;\"><span style=\"color: blue;\">Kemacetan Jakarta Bikin Tim Basket Timor Leste Lelah</span></a></div></td></tr></tbody></table><p><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><table class=\"linksisip\" style=\"width: 540px; color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody><tr><td><div class=\"lihatjg\"><strong>Baca juga:&nbsp;</strong><a href=\"https://news.detik.com/read/2018/02/07/110551/3854347/10/pemprov-dki-siapkan-kota-tua-jadi-pusat-oleh-oleh-asian-games\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"color: rgb(25, 55, 143); font-weight: bold;\"><span style=\"color: blue;\">Pemprov DKI Siapkan Kota Tua Jadi Pusat Oleh-oleh Asian Games</span></a></div></td></tr></tbody></table><p><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"MRT jadi leading sector untuk&nbsp;</span><em style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">membeautification</em><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">&nbsp;atau mempercantik jalan protokol karena di situ yang kita harapkan banyak sekali lalu lalang dari pada atlet official maupun para wisatawan yang datang,\" sambungnya.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sandiaga berencana mempromosikan Jakarta lewat even marathon. Dia mengatakan ada rute dengan lanjang 42 kilometer yang akan mengelilingi lokasi-lokasi menarik yang ada di Jakarta.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Dengan jalur 42 kilometer diperkirakan kita punya 2 setengah jam explosure kepada internasional memperlihat Jakarta. Jadi kami harus pastikan jalur itu steril dan clear untuk sekitar 60 pelari kelas dunia,\" terangnya.&nbsp;</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">(fdu/rvk)</strong></p><p><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sumber : detik.com<br></strong><br></p>', 'sandi-ingin-asian-games-promosikan-jakarta-ke-dunia-internasional', '2', '1', '0', '0', '0', '1', null, null, null);
INSERT INTO `_post` VALUES ('66', '9', '', '', '6 Tersangka Diksar Mapala UII Jilid II Divonis 2 Sampai 4 Tahun Bui', '2018-02-09 09:26:13', '<p><b style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Karanganyar</b><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">&nbsp;- Sebanyak 6 terdakwa kasus penganiayaan dalam Diksar Mapala Universitas Islam Indonesia (UII) Yogyakarta dinyatakan bersalah. Hal tersebut disampaikan hakim dalam sidang putusan.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sidang yang berlangsung, Kamis (8/2) sampai pukul 22.30 WIB itu menghasilkan putusan bahwa keenam terdakwa harus menjalani hukuman penjara. Meski terbukti melakukan penganiayaan secara bersama-sama, hukuman bagi keenamnya tidak sama.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Lima terdakwa, TAR, NA, DK, HS dan RF dihukum 4 tahun penjara. Sedangkan satu terdakwa, TAN divonis 2 tahun 3 bulan penjara. Lama hukuman penjara masih dikurangi masa tahanan.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><div id=\"beacon_8b9d55bcd7\" style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; position: absolute; left: 0px; top: 0px; visibility: hidden;\"><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&amp;campaignid=0&amp;zoneid=642&amp;loc=https%3A%2F%2Fnews.detik.com%2Fberita-jawa-tengah%2Fd-3858037%2F6-tersangka-diksar-mapala-uii-jilid-ii-divonis-2-sampai-4-tahun-bui%3F_ga%3D2.199537130.537181493.1518142319-1115255531.1516191846&amp;referer=https%3A%2F%2Fwww.detik.com%2F&amp;cb=8b9d55bcd7\" width=\"0\" height=\"0\" alt=\"\" style=\"height: 0px; width: 0px;\"></div><p><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">\"Para terdakwa terbukti secara sah dan meyakinkan melanggar pasal 351 ayat 3 juncto pasal 55 ayat 1 ke-1 serta pasal 351 ayat 1 juncto pasal 55 ayat 1 ke-1 KUHP,\" ujar Hakim Ketua Nunik Sri Wahyuni, saat membacakan vonis, di Pengadilan Negeri Karanganyar, Kamis (8/2/2018).</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"></p><table class=\"linksisip\" style=\"width: 540px; color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px; background-color: rgb(255, 255, 255);\"><tbody><tr><td><div class=\"lihatjg\"><strong>Baca juga:&nbsp;</strong><a href=\"https://news.detik.com/read/2017/09/28/195430/3662764/1536/ini-kata-kejari-soal-beda-lama-hukuman-terdakwa-mapala-uii\" target=\"_blank\" data-label=\"List Berita\" data-action=\"Berita Pilihan\" data-category=\"Detil Artikel\" style=\"color: rgb(25, 55, 143); font-weight: bold;\"><span style=\"color: blue;\">Ini Kata Kejari Soal Beda Lama Hukuman Terdakwa Mapala UII</span></a></div></td></tr></tbody></table><p><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Akibat perbuatan keenam terdakwa, 3 orang mahasiswa meregang nyawa saat mengikuti Diksar The Great Camping XXXVII Mapala UII digelar di bukit Tlogodringo, Gondosuli, Tawangmangu, Karanganyar, Januari 2017 lalu.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sebelumnya, 2 orang anggota Mapala UII telah menjalani sidang serupa pada September 2017. Keduanya juga dinyatakan bersalah atas kematian tiga orang peserta diksar.</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><span style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Hakim Ketua saat itu, Mujiono, menetapkan kedua terdakwa bersalah. Wahyudi dihukum kurungan 5 tahun 6 bulan. Sedangkan Angga Septiawan dihukum kurungan 6 tahun.&nbsp;</span><br style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">(sip/sip)</strong></p><p><strong style=\"color: rgb(45, 45, 45); font-family: Helvetica, Arial; font-size: 16px;\">Sumber : detik.com<br></strong><br></p>', '6-tersangka-diksar-mapala-uii-jilid-ii-divonis-2-sampai-4-tahun-bui', '9', '1', '0', '0', '0', '1', null, null, null);
